      const year = date.getFullYear();
      const week = getWeekNumber(date);
      key = `${year}-W${week}`;
    } else if (groupType === "month") {
      const year = date.getFullYear();
      const month = ("0" + (date.getMonth() + 1)).slice(-2);
      key = `${year}-${month}`;
    } else if (groupType === "quarter") {
      const year = date.getFullYear();
      const quarter = Math.floor(date.getMonth() / 3) + 1;
      key = `${year}-Q${quarter}`;
    } else if (groupType === "year") {
      key = `${date.getFullYear()}`;
    } else {
      key = record.date;
    }
    console.log("Record date:", record.date, "Group key:", key);

    // If this group key doesn't exist yet, create an object to hold details.
    if (!groups[key]) {
      groups[key] = { records: [], count: 0, total: 0 };
