<!-- 2) Basic CodeMirror CSS + theme (Eclipse or any other) -->
<style>
@import url("https://cdnjs.cloudflare.com/ajax/libs/codemirror/5.65.11/codemirror.min.css");
@import url("https://cdnjs.cloudflare.com/ajax/libs/codemirror/5.65.11/theme/icecoder.min.css");

html, body {
  height: 100%;
  width: 100%;
  overflow: hidden;
  padding: 0;
  margin: 0;
  box-sizing: border-box;
}
html {
  border: 1px solid #d1d1d1;
  border-radius: 4px;
}
body {
  padding: 0 4px;
  overflow: auto;
}
.CodeMirror {
  height: auto;
  font-family: monospace;
  font-size: 13px;
}
</style>

<!-- 3) JS to manage the editor and Retool interactions -->
<script>
/** Our CodeMirror instance */
let codeEditor = null;
/** Tracks the last code we accepted (from the user or from Retool) */
let mostRecentCode = "";
/** True when we are in the middle of an external setValue() */
let isExternalUpdate = false;
/** Used for debouncing calls to Retool.modelUpdate */
let updateTimer = null;

/** Safely initialize CodeMirror */
function createEditor() {
  if (typeof CodeMirror === "undefined") {
    setTimeout(createEditor, 50);
    return;
  }

  codeEditor = CodeMirror(document.body, {
    value: "",
    mode: "python",
    lineNumbers: true,
    theme: "icecoder",
    indentUnit: 4,     // Typical Python indentation is 4
    tabSize: 4,
    /*
    extraKeys: {
      // If you also want Tab indentation:
      Tab: (cm) => {
        if (cm.somethingSelected()) {
          cm.indentSelection("add");
        } else {
          // Insert 4 spaces
          cm.replaceSelection("    ", "end", "+input");
        }
      },
      "Shift-Tab": (cm) => cm.indentSelection("subtract")
    }
    */
  });

  // When the user edits the code, update Retool after a small debounce
  codeEditor.on("change", () => {
    if (isExternalUpdate) {
      return; // Don't re-fire changes caused by ourselves
    }
    clearTimeout(updateTimer);
    updateTimer = setTimeout(() => {
      const newVal = normalizeLineEndings(codeEditor.getValue());
      // Only update if truly changed
      if (newVal !== mostRecentCode) {
        mostRecentCode = newVal;
        console.log("[CodeMirror -> Retool] Updated code:", newVal);
        window.Retool.modelUpdate({ code: newVal });
      }
    }, 50); // wait 200ms after user stops typing
  });
}

/** Safely set the CodeMirror contents */
function setCode(code) {
  if (!codeEditor) {
    setTimeout(() => setCode(code), 50);
    return;
  }
  const norm = normalizeLineEndings(code);
  const currentNorm = normalizeLineEndings(codeEditor.getValue());
  if (norm !== currentNorm) {
    isExternalUpdate = true;
    console.log("[Retool -> CodeMirror] Setting code:", norm);
    codeEditor.setValue(norm);
    isExternalUpdate = false;
  }
}

/** Normalize line endings to "\n" to avoid mismatch */
function normalizeLineEndings(str) {
  return (str || "").replace(/\r\n/g, "\n");
}

/** Listen for model changes from Retool */
window.Retool.subscribe((model) => {
  if (!model || typeof model.code !== "string") return;
  const newVal = normalizeLineEndings(model.code);
  if (newVal !== mostRecentCode) {
    mostRecentCode = newVal;
    setCode(newVal);
  }
});

/** Start up the editor */
createEditor();
</script>
