let codeEditor = null;
/** Tracks the last code we accepted (from the user or from Retool) */
let mostRecentCode = "";
/** True when we are in the middle of an external setValue() */
let isExternalUpdate = false;
/** Used for debouncing calls to Retool.modelUpdate */
let updateTimer = null;

/** Safely initialize CodeMirror */
function createEditor() {
  if (typeof CodeMirror === "undefined") {
    setTimeout(createEditor, 50);
