          // non-fatal; note in results
          results.push({
            id: cfg.id,
            name: cfg.name || "",
            ok: true,
            task_id: taskId,
            counts: { banks: bankIds.length, books: bookIds.length },
            mode: relative ? "relative" : "absolute",
            warn: `Refresh failed: ${String(e?.message || e)}`
          });
          continue;
        }
      }

      modalReconCeleryQueue.show();
      results.push({
        id: cfg.id,
        name: cfg.name || "",
        ok: true,
        task_id: taskId,
        counts: { banks: bankIds.length, books: bookIds.length },
        mode: relative ? "relative" : "absolute"
      });
    } catch (e) {
      results.push({
        id: cfg?.id ?? rid,
        name: cfg?.name || "",
        ok: false,
        error: String(e?.message || e),
