  // 1) Pipelines selecionados na tabela
  const sel = tableReconPipes.selectedRows || [];
  if (!sel.length) {
    utils.showNotification({
      title: "Nenhum pipeline selecionado",
      description: "Selecione um ou mais pipelines na tabela.",
      intent: "warning"
    });
    return;
  }

  // 2) Auto-match (se ainda fizer sentido)
  const autoMatch = !!(typeof switch3 !== "undefined" ? switch3.value : false);

  const results = [];

  // 3) Rodar cada pipeline selecionado
  for (const row of sel) {
    // ajusta aqui se o ID na tabela vier como outra chave (ex: row.ID)
    const pipelineId = row.id ?? row.ID ?? row.pipeline_id;

    if (!pipelineId) {
      results.push({
        id: "??",
        name: row.name || "",
        ok: false,
        error: "ID do pipeline não encontrado na linha selecionada"
      });
      continue;
    }

    try {
      const res = await Reconciliation_execute.trigger({
        additionalScope: {
          payload: {
            pipeline_id: pipelineId,
            auto_match_100: autoMatch
          }
        }
      });

      const taskId =
        (res && (res.task_id || res.data?.task_id || res.result?.task_id)) || null;

      results.push({
        id: pipelineId,
        name: row.name || "",
        ok: true,
        task_id: taskId
      });
    } catch (e) {
      results.push({
        id: pipelineId,
        name: row.name || "",
        ok: false,
        error: String(e?.message || e)
      });
    }
  }

  // 4) Atualizar fila e mostrar modal (se existir)
  try {
    await Promise.all([
      Queue_get.trigger(),
      QueueCount_get.trigger()
    ]);
  } catch (e) {
    // se der erro aqui, só registra no resumo
    results.push({
      id: "queue-refresh",
      name: "Refresh da fila",
      ok: false,
      error: `Erro ao atualizar fila: ${String(e?.message || e)}`
    });
  }

  if (typeof modalReconCeleryQueue !== "undefined") {
    modalReconCeleryQueue.show();
  }

  // 5) Notificação-resumo
  const ok = results.filter(r => r.ok).length;
  const failed = results.filter(r => !r.ok && !r.skipped).length;

  const lines = results
    .map(r =>
      `- ${r.ok ? "✅" : "❌"} [${r.id}] ${r.name}` +
      (r.task_id ? ` (task: ${r.task_id})` : "") +
      (r.error ? ` — ${r.error}` : "")
    )
    .join("\n");

  utils.showNotification({
    title: `Execução de pipelines: ${ok} ok • ${failed} erro(s)`,
    description: lines,
    duration: 60
