      }

      const R = String(rv ?? "").toLowerCase();
      if (o === "startswith")   return (row) => String(acc(row) ?? "").toLowerCase().startsWith(R);
      if (o === "endswith")     return (row) => String(acc(row) ?? "").toLowerCase().endsWith(R);
      if (o === "not_includes") return (row) => !String(acc(row) ?? "").toLowerCase().includes(R);
