      for (let i=0;i<fns.length;i++){
        const pass = fns[i](row);
        if (n.operator === "or") { if (pass) return true; }
        else { if (!pass) return false; }
      }
      return n.operator === "or" ? false : true;
    };

    compiledCache.set(cacheKey, fn);
    return fn;
