  // ---------- logs head ----------
  log(`${TAG} start | rules=${configs.length} | relative=${relative}`);
  log(`${TAG} row-counts | bank=${bankRows.length} | book=${bookRows.length}`);

  log(`${TAG} base-bank\n${stackToText("bankBase", baseBank, resolveBankCol)}`);
  log(`${TAG} base-book\n${stackToText("bookBase", baseBook, resolveBookCol)}`);

  // ---------- prefilter for relative ----------
  const baseBankFn = compileStack(baseBank, getBank, resolveBankCol);
  const baseBookFn = compileStack(baseBook, getBook, resolveBookCol);
  const baseBankRows = relative ? bankRows.filter(baseBankFn) : bankRows;
  const baseBookRows = relative ? bookRows.filter(baseBookFn) : bookRows;

  log(`${TAG} base-filtered-counts | bank=${baseBankRows.length} | book=${baseBookRows.length}`);

  // ---------- loop ----------
  const counts = {};
  for (let idx = 0; idx < configs.length; idx++) {
    const cfg = configs[idx];

    const bankMerged = relative
      ? mergeStacks(baseBank, cfg.bank_filters || {})
      : normalizeStack(cfg.bank_filters || {});
    const bookMerged = relative
      ? mergeStacks(baseBook, cfg.book_filters || {})
      : normalizeStack(cfg.book_filters || {});

    const bankFn = compileStack(bankMerged, getBank, resolveBankCol);
    const bookFn = compileStack(bookMerged, getBook, resolveBookCol);

    const bankSet = relative ? baseBankRows : bankRows;
    const bookSet = relative ? baseBookRows : bookRows;

    const banks = bankSet.reduce((n, row) => n + (bankFn(row) ? 1 : 0), 0);
    const books = bookSet.reduce((n, row) => n + (bookFn(row) ? 1 : 0), 0);
