      log(`${TAG} raw-bank | ${stackToText("rawBank", cfg.bank_filters || {}, resolveBankCol)}`);
      log(`${TAG} raw-book | ${stackToText("rawBook", cfg.book_filters || {}, resolveBookCol)}`);
      log(`${TAG} merged-bank | ${stackToText("bankMerged", bankMerged, resolveBankCol)}`);
      log(`${TAG} merged-book | ${stackToText("bookMerged", bookMerged, resolveBookCol)}`);
      log(`${TAG} result-counts | banks=${banks} | books=${books}`);
    }
  }

  log(`${TAG} compiled-cache-size=${compiledCache.size}`);
