  log(`${TAG} summary: ${firstN}`);

  // ---------- output ----------
  stateRuleCounts.setValue(counts);
  utils.showNotification({
    title: "Counts computed (fast)",
    description: `Rules: ${configs.length} • Mode: ${relative ? "Relative" : "Absolute"}`,
    intent: "success",
    duration: 3000
  });
})();
