(() => {
  const bankRows = tableBank.selectedRow.data;
  const bookRows = tableBook3.selectedRow.data;

  if (!bankRows || !bookRows) {
    return { error: "Please select records in both tables." };
  }

  const toArray = val => Array.isArray(val) ? val : [val];

  const bankCombo = toArray(bankRows);
  const bookCombo = toArray(bookRows);

  const bank_transaction_details = bankCombo.map(tx => ({
    id: tx.id,
    date: tx.date,
    amount: tx.amount,
    description: tx.memo,
    bank_account: tx.bank_account
      ? {
          id: tx.bank_account.id,
          name: tx.bank_account.name,
        }
      : null,
    entity: tx.entity ? tx.entity.id : null,
    currency: tx.currency?.id || null,
  }));

  const journal_entry_details = bookCombo.map(entry => ({
    id: entry.id,
    date: entry.transaction?.date,
    amount: entry.amount,
    description: entry.transaction?.description,
    account: entry.account
      ? {
          id: entry.account.id,
          account_code: entry.account.account_code,
          name: entry.account.name,
        }
      : null,
    entity: entry.entity
      ? {
          id: entry.entity.id,
          name: entry.entity.name,
        }
      : null,
    transaction: entry.transaction
      ? {
          id: entry.transaction.id,
          description: entry.transaction.description,
          date: entry.transaction.date,
        }
      : null,
  }));

  const sum = arr => arr.reduce((acc, val) => acc + Number(val.amount || 0), 0);
  const sum_bank = sum(bankCombo);
  const sum_book = sum(bookCombo);
  const difference = sum_bank - sum_book;

  const avgDateDiff = (() => {
    const diffs = [];
    bankCombo.forEach(tx => {
      bookCombo.forEach(entry => {
        const date1 = new Date(tx.date);
        const date2 = new Date(entry.transaction?.date);
        if (!isNaN(date1) && !isNaN(date2)) {
          const diff = Math.abs((date1 - date2) / (1000 * 3600 * 24));
          diffs.push(diff);
        }
      });
    });
    if (diffs.length === 0) return 0;
    return diffs.reduce((a, b) => a + b, 0) / diffs.length;
  })();

  const bank_summary = bankCombo
    .map(tx => `ID: ${tx.id}, Date: ${tx.date}, Amount: ${tx.amount}, Desc: ${tx.description}`)
    .join("\n");

  const journal_summary = bookCombo
    .map(entry => {
      const acct = entry.account || {};
      const direction = entry.debit_amount ? "DEBIT" : "CREDIT";
      const amount = Number(entry.debit_amount || entry.credit_amount || 0);
      return `ID: ${entry.transaction?.id}, Date: ${entry.transaction?.date}, JE: ${direction} ${amount} - (${acct.account_code}) ${acct.name}, Desc: ${entry.transaction?.description}`;
    })
    .join("\n");

  return {
    match_type: "manual",
    bank_transaction_details,
    journal_entry_details,
    bank_transaction_summary: bank_summary,
    journal_entries_summary: journal_summary,
    bank_ids: bankCombo.map(tx => tx.id),
    journal_entries_ids: bookCombo.map(entry => entry.id),
    sum_bank,
    sum_book,
    difference,
    avg_date_diff: avgDateDiff,
    confidence_score: 0.95 // arbitrary, since user selects manually
